package wikibrief

import (
	"bytes"
	"context"
	"encoding/base64"
	"encoding/json"
	"reflect"
	"testing"
)

func TestUnit(t *testing.T) {
	b, err := base64.StdEncoding.DecodeString(holyGrail)
	if err != nil {
		t.Error("Error in holyGrail encoding", err)
	}

	ch := make(chan EvolvingPage)
	go func() {
		defer close(ch)
		err := Transform(context.Background(), "en", bytes.NewBuffer(b), func(uint32) bool { return true }, ch)
		if err != nil {
			t.Error(err)
		}
	}()

	var s Summary
	for page := range ch {
		s.PageID = page.PageID
		for r := range page.Revisions {
			s.Revisions = append(s.Revisions, r)
		}
	}

	var st Summary
	bSummary, err := base64.StdEncoding.DecodeString(encodedHolyGrailSummary)
	errt := json.Unmarshal(bSummary, &st)

	switch {
	case err != nil:
		t.Error("Error in holyGrail summary encoding", err)
	case errt != nil:
		t.Error("Error while loading summary test info", errt)
	case !reflect.DeepEqual(s, st):
		t.Error("Error different summaries")
	}
}

type Summary struct {
	PageID    uint32
	Revisions []Revision
}

const encodedHolyGrailSummary = ""

const holyGrail = ""
